description:
En grupp unga engagerade aktivister blir infekterade av 
ostoppbara zombies nar ett skogsbolags genetiska experiment
gar katastofalt snett. Sadan terror kan inte pumpa tillrackligt
med adrenalin genom deras adror for att hjalpa dem ut ur
denna avlagsna skog i denna berattelse om skrack.
